import { Link } from '@chakra-ui/react';
import Logo from './images/netflix.png'
import './App.css';

function App() {
  return (
    <div className="Navbar">
        <img src={Logo} alt='' className="Logo" />
        <div className="Menu">
        <Link href='#'>Home</Link>
        </div>        
        <div className="Menu">
        <Link href='#'>TV Shows</Link>
        </div>        
        <div className="Menu">
        <Link href='#'>Movies</Link>
        </div>
    </div>
  );
}

export default App;
